import React from 'react'
import { Button, Card, CardGroup } from 'semantic-ui-react'
import JobAdvertisementService from '../services/JobAdvertisementService';
export default function Notification() {

    const [jobAdvertisements, setJobAdvertisements] = useState([])


    useEffect(() => {
        let jobAdvertisementService = new JobAdvertisementService();
        jobAdvertisementService.getAllJobAdvertisement().then(result => setJobAdvertisements(result.data.data))
    }, [])
    return (
        <div>
            <CardGroup style={{ marginTop: 50 }}>
                <Card fluid>
                    {
                        jobAdvertisements.map(jobAdvertisement => (
                            <Card.Content>
                                <Card.Header>dfad</Card.Header>
                                <Card.Meta>Position Name</Card.Meta>
                                <Card.Meta>City Name</Card.Meta>
                                <Card.Meta>Salary</Card.Meta>
                                <Card.Description>
                                    Description
                                </Card.Description>
                            </Card.Content>
                        ))
                    }
                </Card>
            </CardGroup>
        </div>
    )
}
